  return(
    <div className="container">

    
  

          {props.data.map((addEmployee)=>(

            <div className="row">

              <div  class="col-lg-2 mx-3 mt-2">
                <h1 className="add1">

                  {addEmployee.id}
                   {addEmployee.name}
                    {addEmployee.surname}
                     {addEmployee.position}

                </h1>
                  </div> 
                    </div>
          ))}


   
       </div>
 )

}



export default Display;
